import React, { Component } from 'react';
import './table.css';
class Table extends Component {

    constructor(props) {
        super(props);
        this.state = {
            status : [],
        }
    }


    componentDidMount() {
        fetch('http://192.168.64.2/this.php',
            {
                method: "POST",
                headers :
                    {
                        'Content-Type' : 'application/x-www-form-urlencoded',
                    },
                body : `start=${this.props.start}&end=${this.props.end}`,
            })
            .then( res => {
                try {
                    if (res.ok) {
                        return res.json()
                    } else {
                        throw new Error(res)
                    }
                }
                catch (err) {
                    console.log(err.message);
                    return {
                        hello : "Hello_world"
                    }
                }
            })
            .then(function (hel) {

            } )
            .catch(err => console.log(err));
    }

    componentDidUpdate(prevProps, prevState, snapshot) {
        console.log(this.state);
    }

    renderTableData()
    {
        return this.props.tab.map((tab, index) => {
                const { row, cleanedStatus, progress } = tab; //destructuring
                return (
                    <tr key={row}>
                        <td>{row}</td>
                        <td>{cleanedStatus}</td>
                        <td>{progress}</td>
                    </tr>
                )
        })
    }

    renderTableHeader() {
        // console.log(this.props.tab);
        return (
            <tr>
                <th>Row</th>
                <th>Clean Status</th>
                <th>Progress</th>
            </tr>
        )
    }

    render() {
        return (
            <div>
                <h1 id='title'>Row Info</h1>
                <table id='RvZ'>
                    <tbody>
                    {this.renderTableHeader()}
                        {this.renderTableData()}
                    </tbody>
                </table>
            </div>
        )
    }
}

export default Table;
